import {useParams} from 'react-router-dom';
import { ApiService } from '../../Service/api.service';

const VideoDetail = () => {
    const { id } =  useParams()

    useEffect(() => {
        const getData = async () => {
            try {
                const data = await ApiService.fetching(`videos?part=snippet,statistics&id=${id}`)
                console.log(data)
            } catch (error) {
                console.log(error);
            }
            
        }
        getData()
    }, [id])
return (
    <div>
        video D: {id}
    </div>
)
}

export default VideoDetail
